import { StyleSheet, View } from 'react-native';
import Title from "./src/components/Title";
import Form from './src/components/Form';

export default function App() {
  return (
    <View>
      <Title />
      <Form />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  text: {
    color: "#000"
  }
});
